    true,nt"url": null,nt"notes": "The Aeronautical Information System (AIS)
    is a leased weather automated system that provides a means of collecting and distributing
    aeronautical weather information (service A messages); processing flight plans,
    flight movement and control messages; entering and retrieving of Notice to Airmen
    (NOTAM) and other operational messages (service B) for the general and military
    aviation communities throughout the United States. Its geographically dispersed
